// // https://api.mfapi.in/mf/100049


import { useEffect, useState } from "react"

import React from "react";
import "./index.css"


function App(){
  const[column,setColumn] = useState([])
  const[records,setRecords] = useState([])
  useEffect(()=>{
      fetch("https://api.mfapi.in/mf/100049")
      .then(res => res.json())
      .then(obj =>{
        setColumn(Object.keys(obj.data[0]))
        setRecords(obj.data)
      })
  },[])
  return(
     <div>
      <table className="tables">
        <thead>
          <tr>
            {column.map((c,i) => (
              <th key={i}>{c}</th>
            ))}
          </tr>
        </thead>
<tbody>
  {
    records.map((record,i) =>(
      <tr key={i}>
         <td>{record.date}</td>
         <td>{record.nav}</td>
      </tr>
    ))
  }
</tbody>
      </table>
     </div>
  )
}
export default App;







